import React, { useState, useEffect } from "react";
import { toast } from "react-toastify";
import { Link } from "react-router-dom";
import { createLicenseApi, getAllLicenseApi } from "../apis/Api";

export const Dashboard = () => {
  const [licenseName, setLicenseName] = useState("");
  const [licenseImage, setLicenseImage] = useState(null);
  const [previewImage, setPreviewImage] = useState(null);

  const handleImage = (event) => {
    const file = event.target.files[0];
    setLicenseImage(file);
    setPreviewImage(URL.createObjectURL(file));
  };

  const [license, setLicense] = useState([]);
  useEffect(() => {
    getAllLicenseApi().then((res) => {
      setLicense(res.data.license);
    });
  }, []); // Added an empty dependency array to ensure useEffect runs only once

  const handleSubmit = (e) => {
    e.preventDefault();
    const formData = new FormData();
    formData.append("licenseName", licenseName);
    formData.append("licenseImageUrl", licenseImage);

    createLicenseApi(formData)
      .then((res) => {
        if (res.data.success === false) {
          toast.error(res.data.message);
        } else {
          toast.success(res.data.message);
        }
      })
      .catch((err) => {
        console.log(err);
        toast.error("Internal Server Error");
      });
  };

  return (
    <>
      <div className="m-4">
        <div className="d-flex justify-content-between">
          <h1>Dashboard</h1>
          <button
            type="button"
            className="btn btn-primary"
            data-bs-toggle="modal"
            data-bs-target="#exampleModal"
          >
            Add License
          </button>
          <div
            className="modal fade"
            id="exampleModal"
            tabIndex="-1"
            aria-labelledby="exampleModalLabel"
            aria-hidden="true"
          >
            <div className="modal-dialog">
              <div className="modal-content">
                <div className="modal-header">
                  <h5 className="modal-title" id="exampleModalLabel">
                    Add License
                  </h5>
                  <button
                    type="button"
                    className="btn-close"
                    data-bs-dismiss="modal"
                    aria-label="Close"
                  ></button>
                </div>
                <div className="modal-body">
                  <label>License Number</label>
                  <input
                    onChange={(e) => {
                      setLicenseName(e.target.value);
                    }}
                    className="form-control"
                    type="text"
                    placeholder="Enter License number"
                  />
                  <label>License Image</label>
                  <input
                    onChange={handleImage}
                    className="form-control"
                    type="file"
                  />
                  {previewImage && (
                    <img
                      src={previewImage}
                      className="mt-2"
                      alt="Preview"
                      style={{ maxWidth: "100%" }}
                    />
                  )}
                </div>
                <div className="modal-footer">
                  <button
                    type="button"
                    className="btn btn-secondary"
                    data-bs-dismiss="modal"
                  >
                    Close
                  </button>
                  <button
                    onClick={handleSubmit}
                    type="button"
                    className="btn btn-primary"
                  >
                    Save changes
                  </button>
                </div>
              </div>
            </div>
          </div>
        </div>

        <table className="table mt-2">
          <thead className="table-dark">
            <tr>
              <th scope="col">License Name</th>
              <th scope="col">License Image</th>
              <th scope="col">Action</th>
            </tr>
          </thead>
          <tbody>
            {license.map((item) => (
              <tr key={item._id}>
                <td>
                  <h5>{item.licenseName}</h5>
                </td>
                <td className="text-center">
                  <img
                    src={item.licenseImageUrl}
                    height={150}
                    width={120}
                    alt={item.licenseName}
                  />
                </td>
                {/* Add the rest of the code for Action column here */}
              </tr>
            ))}
          </tbody>
        </table>
      </div>
    </>
  );
};
